  return <div class="overflow-auto">.</div>;
};

const columns = [
  {
    dataField: "id",
    text: "Product ID",
  },
  {
    dataField: "name",
    text: "Product Name",
    filter: textFilter(),
  },
  {
    dataField: "price",
    text: "Product Price",
    filter: textFilter(),
  },
];

<BootstrapTable
  keyField="id"
  data={products}
  columns={columns}
  filter={filterFactory()}
/>;

export default ListCourses;
